import React from 'react';
import './editForm.css';
import FormForAddAndEditProduct from '../formForAddOrEditProduct/Form';
import { useSelector } from 'react-redux';



const EditForm = () => {
    const store = useSelector(state => state.formSlice)
    const {productById} = store
    return (
        <div className="editForm">
            <FormForAddAndEditProduct
                initialValues={{
                    name: productById.name, 
                    price: productById.price,
                    origin: productById.origin
                }}
                // handleSubmit={} 
            />
            <button 
                type="reset" 
                className="resetFormButton"
            >
                RESET
            </button>
            <button 
                type="cancel" 
                className="cancelChangesButton"
            >
                CANCEL
            </button>
        </div>
    )
}

export default EditForm;
